        public int SelfDischargeCurrent { get; set; } // uA
        public int InternalResistance { get; set; } // uOhm
        private double _currentCapacity; // mAh
        private double _soc; // *100%
        private int _voltage; // mV
        private const int SecondsInHour = 60 * 60;
        private const int MaxSoc = 10000; // *100%
        private const int RelaxTime = 3600;
        private const int MinRelaxTime = 1;
        private int _relaxTimeCounter = MinRelaxTime;
        private const int EndOfSoc = 400; // *100%
        private int _voltageBeforePreCharge;
        private bool _isStartSocInitialized;
        private int _preChargeTime;
        private const int PreChargePeriod = 250;
        private const int MaxDeltaU = 15;
        public int BalancingResistance { get; set; } // Ohm
        private int _balanceCurrent; // mA
        public bool StatusVMax { get; set; } = false;
        public bool StatusVMin { get; set; } = false;
        public bool StatusBalancing { get; set; } = false;
        private bool _relaxAfterDischargeStarted;
        private bool _relaxAfterChargeStarted;
        private const double RelaxAfterChargeC1 = 1722.68907563025;
        private int _voltageBeforeRelax;
        private int _nominalCapacity; // mAh

        public Cell(int capacity, int selfDischargeCurrent, int internalResistance, int balanceResistance)
        {
            NominalCapacity = capacity;
            SelfDischargeCurrent = selfDischargeCurrent;
            InternalResistance = internalResistance;
            BalancingResistance = balanceResistance;
            UpdateSoc();
            SetNoLoadVoltage();
        }

        private void UpdateVoltageRelax(int time)
        {
            if (_relaxAfterDischargeStarted)
            {
                UpdateVoltageRelaxAfterChargingProcess(false, time);
            }
            else if (_relaxAfterChargeStarted)
            {
                UpdateVoltageRelaxAfterChargingProcess(true, time);
            }
        }

        private void UpdateVoltageRelaxAfterChargingProcess(bool isChargingProcess, int time) // true -> Was charge; false -> Was discharge
        {
            _voltage = (isChargingProcess) 
                ? CalculateVoltageRelaxAfterCharge()
                : CalculateVoltageRelaxAfterDischarge();
            if (_relaxTimeCounter >= RelaxTime)
            {
                _relaxAfterChargeStarted = false;
                _relaxAfterDischargeStarted = false;
            }
            _relaxTimeCounter += time;
        }

        private int CalculateVoltageRelaxAfterCharge()
        {
            int x1 = MinRelaxTime;
            int x2 = RelaxTime;
            int soc = (int) Math.Round(_soc);
            int y1 = _voltageBeforeRelax;
            double y2 = _noLoadVoltage[soc];
            double c = y1 + (y1 - y2) / RelaxAfterChargeC1;
            double b = (y2 * Math.Pow(x1, 2) - y1 * Math.Pow(x2, 2) - c * (Math.Pow(x1, 2) - Math.Pow(x2, 2))) / (x1 * Math.Pow(x2, 2) - Math.Pow(x1, 2) * x2);
            double a = (y1 + b * x1 - c) / Math.Pow(x1, 2);
            int x = _relaxTimeCounter;
            return (int)(a * Math.Pow(x, 2) - b * x + c);
        }

        private int CalculateVoltageRelaxAfterDischarge()
        {
            int soc = (int) Math.Round(_soc);
            double y2 = _noLoadVoltage[soc];
            return (int)Math.Round(CalculateVoltageLn(MinRelaxTime, _voltageBeforeRelax, RelaxTime, y2, _relaxTimeCounter));
        }

        private double CalculateVoltageLn(double x1, double y1, double x2, double y2, double x)
        {
            double a = (y1 - y2) / Math.Log(x1 / x2);
            return a * Math.Log(x) + y1;
        }

        public void StartDischargeRelax()
        {
            _relaxAfterChargeStarted = false;
            _relaxAfterDischargeStarted = true;
            _relaxTimeCounter = MinRelaxTime;
            _voltageBeforeRelax = _voltage;
        }

        public void StartChargeRelax()
        {
            _relaxAfterDischargeStarted = false;
            _relaxAfterChargeStarted = true;
            _relaxTimeCounter = MinRelaxTime;
            _voltageBeforeRelax = _voltage;
        }

        public bool IsRelaxFinish()
        {
            return (_relaxAfterDischargeStarted == false) && (_relaxAfterChargeStarted == false);
        }

        private double IncrementCapacity(double current, int time)
        {
            return _currentCapacity + current * time / SecondsInHour;
        }

        private void UpdateCapacity(double current, int time)
        {
            double newCapacity = IncrementCapacity(current, time);
            _currentCapacity = (newCapacity >= NominalCapacity)
                ? NominalCapacity
                : (newCapacity <= 0)
                    ? 0
                    : newCapacity;
        }

        public void SetSoc(int soc)
        {
            _soc = soc;
            _currentCapacity = NominalCapacity * _soc / MaxSoc;
            SetNoLoadVoltage();
        }

        private void UpdateSoc()
        {
            _soc = _currentCapacity * MaxSoc / NominalCapacity;
        }

        private void UpdateVoltage(int current, int time)
        {
            int soc = (int)Math.Round(_soc);
            int absCurrent = Math.Abs(current);
            int deltaU;
            if (absCurrent >= BaseCurrent)
            {
                deltaU = (absCurrent - BaseCurrent) * InternalResistance / 1000000;
            }
            else
            {
                int baseVoltage = (current >= 0) ? _uChargeI20[soc] : _uDischargeI20[soc];
                deltaU = (int)(-Math.Abs(baseVoltage - _noLoadVoltage[soc]) * (1 - (double)absCurrent / BaseCurrent));
                int deltaSoc = (soc <= EndOfSoc) ? soc : (MaxSoc - soc);
                if (deltaSoc <= EndOfSoc)
                {
                    deltaU = (int)(deltaU * (double)deltaSoc / EndOfSoc);
                }
            }

            int voltage = (current == 0) 
                    ? _noLoadVoltage[soc] 
                    : (current > 0)
                        ? _uChargeI20[soc] + deltaU
                        : _uDischargeI20[soc] - deltaU;

            deltaU = Math.Abs(voltage - _voltage);
            if (deltaU >= MaxDeltaU || _isStartSocInitialized)
            {
                voltage = CalculateVoltagePreCharge(voltage, time);
            }

            _voltage = voltage;
        }

        private int CalculateVoltagePreCharge(int voltageAfterPreCharge, int time)
        {
            if (_isStartSocInitialized == false)
            {
                _preChargeTime = 1;
                _voltageBeforePreCharge = _voltage;
                _isStartSocInitialized = true;
            }

            if (_preChargeTime >= PreChargePeriod)
            {
                _preChargeTime = PreChargePeriod;
                _isStartSocInitialized = false;
            }

            int voltage = (int) Math.Round(CalculateVoltageLn(1, _voltageBeforePreCharge, PreChargePeriod, voltageAfterPreCharge, _preChargeTime));
            _preChargeTime += time;

            return voltage;
        }

        private void SetNoLoadVoltage()
        {
            _voltage = _noLoadVoltage[(int)Math.Round(_soc)];
        }

        public void UpdateData(int current, int time)
        {
            double balancingCurrent = StatusBalancing ? ((double)_voltage / BalancingResistance) : 0;
            _balanceCurrent = (int)balancingCurrent;
            double chargeCurrent = current - balancingCurrent - ((double)SelfDischargeCurrent / 1000);
            UpdateCapacity(chargeCurrent, time);
            UpdateSoc();
            if (_relaxAfterChargeStarted || _relaxAfterDischargeStarted)
            {
                UpdateVoltageRelax(time);
            }
            else
            {
                UpdateVoltage(current, time);
            }
        }

        public void ResetData()
        {
            _balanceCurrent = 0;
            _currentCapacity = 0;
            _relaxTimeCounter = MinRelaxTime;
            _relaxAfterChargeStarted = false;
            _relaxAfterDischargeStarted = false;
            UpdateSoc();
            SetNoLoadVoltage();
        }

        public void NextCharge()
        {
            _balanceCurrent = 0;
            _relaxTimeCounter = MinRelaxTime;
            _relaxAfterChargeStarted = false;
            _relaxAfterDischargeStarted = false;
            UpdateSoc();
            SetNoLoadVoltage();
        }

        public int GetCapacityLevel()
        {
            return (int)Math.Round(_currentCapacity);
        }

        public int GetSoc()
        {
            return (int)Math.Round(_soc);
        }

        public int GetVoltage()
        {
            return _voltage;
        }

        public int GetBalanceCurrent()
        {
            return _balanceCurrent;
        }

        public int GetSocFromUCharge(int current)
        {
            int index = CheckLimits(_voltage - UChargeMin, 0, _socFromUChargeI20.Length - 1);
            int soc;
            if (current < 3)
            {
                soc = _socFromUChargeI1[index];
            } 
            else if (current < 8)
            {
                soc = _socFromUChargeI5[index];
            }
            else if (current < 13)
            {
                soc = _socFromUChargeI10[index];
            }
            else if (current < 18)
            {
                soc = _socFromUChargeI15[index];
            }
            else
            {
                soc = _socFromUChargeI20[index];
            }
            return soc;
        }

        int CheckLimits(int value, int min, int max)
        {
            return (value > max)
                ? max
                : (value < min)
                    ? min
                    : value;
        }
    }
